import React, { Component } from 'react';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,MDBIcon,MDBFormInline,
  MDBCollapse,
  MDBContainer
} from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';

class Sidenav extends Component {
  state = {
    collapseID: '',
    collapseID1:'',
    collapseID2:'',
    collapseID3:''

  };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ''
    }));
  };
  toggleCollapse1 = collapseID1 => () => {
    this.setState(prevState => ({
      collapseID1: prevState.collapseID1 !== collapseID1 ? collapseID1 : ''
    }));
  };

  render() {
    const { collapseID } = this.state;
    const { collapseID1 } = this.state;
    return (
      <Router>

          <MDBNavbar
            color='light-blue lighten-4'
            style={{ marginTop: '20px' }}
            light

          >
            <div onClick={this.toggleCollapse('navbarCollapse0')}> <MDBNavbarBrand>Discount</MDBNavbarBrand>
            <MDBIcon
                icon={collapseID === 'navbarCollapse0' ? 'angle-up' : 'angle-down'}
              />

            </div>




              <MDBCollapse
                id='navbarCollapse0'
                isOpen={this.state.collapseID}
                navbar
              >
                <MDBNavbarNav left>
                  <MDBNavItem>
                    <MDBNavLink to='#!'>Home</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to='#!'>Link</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to='#!'>Profile</MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>

          </MDBNavbar>



          <MDBNavbar
            color='light-blue lighten-4'
            style={{ marginTop: '20px' }}
            light

          >
              <div  onClick={this.toggleCollapse1('navbarCollapse1')}>
              <MDBNavbarBrand>Brands</MDBNavbarBrand>
            <MDBIcon
                icon={collapseID1 === 'navbarCollapse1' ? 'angle-up' : 'angle-down'}
              />

              </div>




              <MDBCollapse
                id='navbarCollapse1'
                isOpen={this.state.collapseID1}
                navbar
              >
                <MDBNavbarNav left>
                  <MDBNavItem>
                  <MDBFormInline className="md-form">>
                  <MDBIcon icon="search" />
        <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search" aria-label="Search" />
        </MDBFormInline>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to='#!'>Link</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to='#!'>Profile</MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>

          </MDBNavbar>



      </Router>
    );
  }
}

export default Sidenav;
